import React from 'react';
import { Main } from './contents';
import { MainName } from './contents';
import { MainText } from './contents';
import { SiTwitter } from "react-icons/si";
import { SiGithub } from "react-icons/si";
import { SiQiita } from "react-icons/si";

function SocialMain() {
  return (
    <Main>
      <MainName className="English"><SiTwitter />Twitter</MainName>
      <MainText><a href="https://mobile.twitter.com/yoyo_unofficial" target="_blank" rel="noopener noreferrer">https://twitter.com/yoyo_unofficial</a></MainText>
      <MainName className="English"><SiGithub />Github</MainName>
      <MainText><a href="https://github.com/Ryotaross" target="_blank" rel="noopener noreferrer">https://github.com/Ryotaross</a></MainText>
      <MainName className="English"><SiQiita />Qiita</MainName>
      <MainText><a href="https://qiita.com/Ryotaross" target="_blank" rel="noopener noreferrer">https://qiita.com/Ryotaross</a></MainText>
    </Main>
  );
}

export default SocialMain;
